import React from "react";
import "./ColorPick.css";

const ColorPick = () => {
  void function onChangeColor(colorID) {
    if (colorID === 1) {
      alert(colorID);
    } else if (colorID === 2) {
      alert(colorID);
    } else if (colorID === 3) {
      alert(colorID);
    } else if (colorID === 4) {
      alert(colorID);
    }
  };
  return (
    <table className="ColorTable">
      <tbody>
        <tr>
          <td>
            <div className="blueTemplate" onClick={this.onChangeColor(1)}></div>
          </td>
          <td>
            <div
              className="purpleTemplate"
              onClick={this.onChangeColor(1)}
            ></div>
          </td>
          <td>
            <div
              className="greenTemplate"
              onClick={this.onChangeColor(1)}
            ></div>
          </td>
          <td>
            <div className="grayTemplate" onClick={this.onChangeColor(1)}></div>
          </td>
        </tr>
      </tbody>
    </table>
  );
};

export default ColorPick;
